def project = testRunner.testCase.testSuite.project ;
def tcase = project.testSuites["LogicalDoc TestSuite"].testCases["Login"] ; 
def tstep = tcase.getTestStepByName("Login");

def responseTestSuite1 = tstep.getPropertyValue("response");
log.info(responseTestSuite1.toString());

def gutils = new com.eviware.soapui.support.GroovyUtils( context );

def holder = gutils.getXmlHolder("$responseTestSuite1");

holder.declareNamespace('soapenv', "http://schemas.xmlsoap.org/soap/envelope/")
holder.declareNamespace('ns2', "http://ws.logicaldoc.com")
holder.declareNamespace('ns1', 'http://endpoint.soap.webservice.logicaldoc.com')

def byteResponse = holder.getNodeValue("/soapenv:Envelope[1]/soapenv:Body[1]/ns2:loginResponse/return")

log.info(byteResponse.toString());

testRunner.testCase.setPropertyValue("sid", "$byteResponse")

testFile = new File(testRunner.testCase.testSuite.project.getPath())
resourceDir = new File(testFile.getParentFile().getParentFile(), "resources")
inputFile = new File(resourceDir,"sid.txt")
inputFile.write("$byteResponse")

